import React from 'react'

function Itemlist() {
  return (
    <div>

    {Object.keys(items).map((keyName, i) => (
      <div key={i}>
          <div><Item taskObject={items[keyName]}/></div>
      </div>
    ))} 

    </div>
  )
}

export default Itemlist
